USE CDW
GO
	
			SELECT DISTINCT
				PDXX.DF_SPE_ACC_ID AS AccountNumber,
				PDXX.DM_PRS_X AS First_Name,
				PDXX.DM_PRS_LST AS Last_Name,
				PDXX.DX_ADR_EML AS Email,
				LNXX.LN_DLQ_MAX AS Days_Delinquent,
				PDXX.DX_STR_ADR_X AS Address_X,
				PDXX.DX_STR_ADR_X AS Address_X,
				PDXX.DX_STR_ADR_X AS Address_X,
				PDXX.DM_CT AS City,
				PDXX.DC_DOM_ST AS State,
				PDXX.DF_ZIP_CDE AS Zip,
				PDXX.DN_DOM_PHN_ARA AS Area_Code,
				PDXX.DN_DOM_PHN_ARA + PDXX.DN_DOM_PHN_XCH + PDXX.DN_DOM_PHN_LCL AS Phone
			FROM
				PDXX_PRS_NME PDXX
				INNER JOIN LNXX_LON LNXX
					ON LNXX.BF_SSN = PDXX.DF_PRS_ID
					AND LNXX.LC_STA_LONXX = 'R'
					AND LNXX.LA_CUR_PRI > X
				INNER JOIN DWXX_DW_CLC_CLU DWXX
					ON DWXX.BF_SSN = LNXX.BF_SSN
					AND DWXX.LN_SEQ = LNXX.LN_SEQ
					AND DWXX.WC_DW_LON_STA = 'XX'
				INNER JOIN PDXX_PRS_ADR PDXX
					ON PDXX.DF_PRS_ID = PDXX.DF_PRS_ID
				LEFT OUTER JOIN PDXX_PRS_ADR_EML PDXX
					ON PDXX.DF_PRS_ID = PDXX.DF_PRS_ID
					AND PDXX.DC_STA_PDXX = 'A'
				LEFT OUTER JOIN PDXX_PRS_PHN PDXX
					ON PDXX.DF_PRS_ID = PDXX.DF_PRS_ID
					AND PDXX.DI_PHN_VLD = 'Y'
				LEFT OUTER JOIN
				( 
					SELECT
						BF_SSN,
						LN_SEQ,
						MAX(LN_DLQ_MAX) AS LN_DLQ_MAX
					FROM
						LNXX_LON_DLQ_HST LNXX
					WHERE
						LNXX.LC_STA_LONXX = 'X'
					GROUP BY
						BF_SSN,
						LN_SEQ
				) LNXX
					ON LNXX.BF_SSN = LNXX.BF_SSN
					AND LNXX.LN_SEQ = LNXX.LN_SEQ
			WHERE
				LEFT(PDXX.DF_ZIP_CDE, X) IN
